import classes from './BooksList.module.css';
import BookItem from './BookItem';

const BookList = (props) => {
  return (
    <ul className={classes.list}>
      {props.data.map((book) => (
        <BookItem
          id={book.id}
          name={book.author}
          description={book.description}
        />
      ))}
    </ul>
  );
};
export default BookList;
